import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function ChatbotPage() {
    const navigate = useNavigate();
    const [messages, setMessages] = useState([
        {
            id: 1,
            text: "안녕하세요! Seoul AI 상황실 챗봇입니다. 무엇을 도와드릴까요?",
            sender: "bot",
            time: new Date().toLocaleTimeString()
        }
    ]);
    const [inputMessage, setInputMessage] = useState('');

    const handleSendMessage = () => {
        if (inputMessage.trim()) {
            const newMessage = {
                id: Date.now(),
                text: inputMessage,
                sender: "user",
                time: new Date().toLocaleTimeString()
            };
            setMessages([...messages, newMessage]);
            setInputMessage('');
            
            // 봇 응답 시뮬레이션
            setTimeout(() => {
                const botResponse = {
                    id: Date.now() + 1,
                    text: "메시지를 받았습니다. 곧 답변드리겠습니다.",
                    sender: "bot",
                    time: new Date().toLocaleTimeString()
                };
                setMessages(prev => [...prev, botResponse]);
            }, 1000);
        }
    };

    const handleKeyPress = (e) => {
        if (e.key === 'Enter') {
            handleSendMessage();
        }
    };

    return (
        <div style={{
            minHeight: '100vh',
            background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
            padding: '20px'
        }}>
            <div style={{
                maxWidth: '800px',
                margin: '0 auto',
                background: 'rgba(255, 255, 255, 0.1)',
                backdropFilter: 'blur(10px)',
                borderRadius: '20px',
                padding: '20px',
                height: '90vh',
                display: 'flex',
                flexDirection: 'column'
            }}>
                {/* Header */}
                <div style={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    alignItems: 'center',
                    marginBottom: '20px',
                    paddingBottom: '15px',
                    borderBottom: '1px solid rgba(255, 255, 255, 0.2)'
                }}>
                    <h1 style={{ color: 'white', margin: 0 }}>🤖 Seoul AI 챗봇</h1>
                    <button 
                        onClick={() => navigate('/')}
                        style={{
                            background: 'rgba(255, 255, 255, 0.2)',
                            border: 'none',
                            borderRadius: '10px',
                            padding: '10px 20px',
                            color: 'white',
                            cursor: 'pointer'
                        }}
                    >
                        홈으로
                    </button>
                </div>

                {/* Messages Container */}
                <div style={{
                    flex: 1,
                    overflowY: 'auto',
                    marginBottom: '20px',
                    padding: '10px'
                }}>
                    {messages.map(message => (
                        <div key={message.id} style={{
                            display: 'flex',
                            justifyContent: message.sender === 'user' ? 'flex-end' : 'flex-start',
                            marginBottom: '15px'
                        }}>
                            <div style={{
                                maxWidth: '70%',
                                padding: '12px 16px',
                                borderRadius: '15px',
                                background: message.sender === 'user' 
                                    ? 'rgba(255, 255, 255, 0.9)' 
                                    : 'rgba(255, 255, 255, 0.2)',
                                color: message.sender === 'user' ? '#333' : 'white',
                                border: '1px solid rgba(255, 255, 255, 0.3)'
                            }}>
                                <p style={{ margin: 0 }}>{message.text}</p>
                                <small style={{ 
                                    opacity: 0.7, 
                                    fontSize: '0.8em',
                                    color: message.sender === 'user' ? '#666' : '#ddd'
                                }}>
                                    {message.time}
                                </small>
                            </div>
                        </div>
                    ))}
                </div>

                {/* Input Area */}
                <div style={{
                    display: 'flex',
                    gap: '10px',
                    padding: '15px',
                    background: 'rgba(255, 255, 255, 0.1)',
                    borderRadius: '15px'
                }}>
                    <input
                        type="text"
                        value={inputMessage}
                        onChange={(e) => setInputMessage(e.target.value)}
                        onKeyPress={handleKeyPress}
                        placeholder="메시지를 입력하세요..."
                        style={{
                            flex: 1,
                            padding: '12px 16px',
                            border: 'none',
                            borderRadius: '10px',
                            background: 'rgba(255, 255, 255, 0.9)',
                            outline: 'none'
                        }}
                    />
                    <button
                        onClick={handleSendMessage}
                        style={{
                            padding: '12px 20px',
                            background: 'linear-gradient(45deg, #667eea, #764ba2)',
                            border: 'none',
                            borderRadius: '10px',
                            color: 'white',
                            cursor: 'pointer',
                            fontWeight: 'bold'
                        }}
                    >
                        전송
                    </button>
                </div>
            </div>
        </div>
    );
}

export default ChatbotPage;
